import React from 'react'

export const Feature = () => {
  return (
    <div className="gpt3_features-container_feature">
      <div className="gpt3_features-container-feature-title">
        <h1>{title}</h1>
      </div>
      <div className="gpt3-features-container-feature-text">
        <p>{text}</p>
      </div>
    </div>
  )
}
